import React from "react";

import manoSpock from "../../images/engranaje.png";

import "./Background.css";

const Background = () => {
  return (
    <div className="Background">
      <img
        src={manoSpock}
        alt="Mano Spock"
        style={{ position: "absolute", top: "5vw", left: "8vw", width: "6vw" }}
      />
    </div>
  );
};

export default Background;
